import PlayerMenu from "./Players/PlayerMenu";
import One from "./Test/One";
import Two from "./Test/Two";

const Bottom = ({ playerMenuVisible }) => {
  let content;
  if (playerMenuVisible) {
    content = <PlayerMenu />;
  } else {
    content = (
      <>
        <One />
        <Two />
      </>
    );
  }

  return (
    <section className="h-50 bg-white">
      <>{content}</>
    </section>
  );
};

export default Bottom;
